message:
Bom sabermos!

QUEM É O CONSELHO DA DEFESA NACIONAL?

O Gabinete de Segurança Institucional (GSI), o também CDN atualmente comandado pelo ministro-chefe general Augusto Heleno, faz parte de um dos órgãos que integram a Presidência da República, sendo responsável pela assistência ao presidente do Brasil no assessoramento pessoal em assuntos militares e de segurança. Através da Lei Nº 13.844, de 2019, o GSI sofreu alterações e ficou estruturado da seguinte forma:
•  o gabinete do Ministro;
•  a secretária Executiva (Departamento de Gestão, Assessoria de Planejamento e Assuntos Estratégicos);
•  três secretarias (Secretaria de Segurança e Coordenação Presidencial; Secretaria de Assuntos de Defesa e Segurança Nacional; Secretaria de Coordenação de Sistemas);
•  agência brasileira de inteligência.

É O ORGÃO TAMBÉM QUE PROTEGE A SOBERANIA
